import '../index.css';

function Medaillion() {
    return(
        <div class="container md">
            <div class="grid grid-cols-2 gap-4">
                <h2 class="text-2xl font-bold text-white">Medallion</h2>
            </div>
        </div>
    )
}

export default Medaillion;
